number_lat = re.compile(r'[ABEKMHOPCTYX_]\d{3}[ABEKMHOPCTYX_]{2}\d{2,3}|[ABEKMHOPCTYX_]{2}\d{5,6}')
num_lat = re.compile(r'[ABEKMHOPCTYX_]\d{3}[ABEKMHOPCTYX_]{2}|[ABEKMHOPCTYX_]{2}\d{5,6}')
number_by = re.compile(r'\d{4}[A-Z]{2}-\d')
